#include <string.h>
#include <stdbool.h>

long long beautifulSubstrings(char* s, int k) {
    long long count = 0;
    int length = strlen(s);
    for (int start = 0; start < length; ++start) {
        int vowelCount = 0, consonantCount = 0;
        for (int end = start; end < length; ++end) {
            // Increment vowel or consonant count based on the current character
            if (s[end] == 'a' || s[end] == 'e' || s[end] == 'i' || s[end] == 'o' || s[end] == 'u') {
                ++vowelCount;
            } else {
                ++consonantCount;
            }
            // Check if current substring is beautiful
            if (vowelCount == consonantCount && (vowelCount * consonantCount) % k == 0) {
                ++count;
            }
        }
    }
    return count;
}
